import Logo from "./Logo";
import React from "react";

const Signup = () => {
  return (
    <div className="login container-fluid">
      <div className="login-content ">
        <div className="login-split-content">
            <a href="/"><Logo /></a>
        
        
        <h1 style={{fontWeight:'1000',fontSize:'50px',color:'#39364F'}} className="mb-4">Create an account</h1>
        <input type="text" placeholder="Email address" className="form-control mt-3"/>
        <input type="password" placeholder="Password" className="form-control  mt-3"/>
        <button type="submit" className="submit mt-3 mb-4">Log in</button>
        <button type="submit" className="google form-control"><div className="img"></div>Sign up with Google</button>
        <span className="mt-2">
            Existing user ? <a href="/signup" className="text-decoration-none">signup</a>
        </span>
        </div>
        
      </div>
      <div className="login-image"></div>
    </div>
  );
};

export default Signup;
